import React from "react";
import './App.css';
import  Home from "./pages/Home"
import Search from "./pages"
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div className="app">
    <Router>
       <Routes>
          <Route path='./search' element={<Search/>} />
          <Route path='/' element={<Home/>}/>
       </Routes>
    </Router>  
    </div>
  );
}

export default App;
